import React from "react";
import { useParams, useNavigate } from "react-router";


// We import bootstrap to make our application look better.
import "bootstrap/dist/css/bootstrap.css";

// We import NavLink to utilize the react router.
import { NavLink } from "react-router-dom";
import { Link } from "react-router-dom";


// Here, we display our Navbar
export default function Navbar() {
    return (
        <div>
            <nav className="navbar navbar-expand-lg navbar-light bg-light">
                <NavLink className="navbar-brand" to="/">
                    <img style={{ "width": 25 + '%' }} src="https://www.freepnglogos.com/uploads/vodafone-png-logo/vodafone-employment-opportunities-22.png"></img>
                </NavLink>
                <button
                    className="navbar-toggler"
                    type="button"
                    data-toggle="collapse"
                    data-target="#navbarSupportedContent"
                    aria-controls="navbarSupportedContent"
                    aria-expanded="false"
                    aria-label="Toggle navigation"
                >
                    <span className="navbar-toggler-icon"></span>
                </button>

                <div className="collapse navbar-collapse" id="navbarSupportedContent">
                    <ul className="navbar-nav ml-auto">
                        <li className="nav-item">
                            <Link className="btn btn-link" to={"/create/industriesDB"}>
                                Create Industries Record
                            </Link>
                            <Link className="btn btn-link" to={"/create/iotDB"}>
                                Create IoT Record
                            </Link>
                        </li>
                    </ul>
                </div>
            </nav>
        </div>
    );
}
